pr_body:
Currently (in master) we start descending as soon as mode land is switched on. This may or may not be desirable. After discussion with others, I think it's best the vehicle does not descend until it's close to the prec land target. The exact limits can be set by the new param added in this PR.

Another change in this PR is the removal of "pos_control->get_pos_error_xy_cm()" to get the distance from the target. This is because #18111 requires this change with the new pos controller implementation, it isn't really needed for this PR but will make my life easier. 

@khancyr do you think this logic is okay? I will be happy to take suggestions on how this can be better
